import React from 'react';

function App() {
    // Тимчасово замінимо продукти на статичний масив
    const products = [
        { id: 1, name: 'Product 1', count: 5 },
        { id: 2, name: 'Product 2', count: 3 },
    ];

    return (
        <div>
            <h1>Product List</h1>
            {products.map((p) => (
                <div key={p.id}>
                    <h3>{p.name}</h3>
                    <p>Count: {p.count}</p>
                </div>
            ))}
        </div>
    );
}

export default App;
